import java.util.Set;

public class FactoryMethodExemplo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Set<String> lista = Set.of("Banana", "Maça", "Pera", "Banana", "Maça", "Pera");
		
		for(String s : lista) {
			System.out.println(s);
		}

	}

}
